import React, { useEffect, useState } from 'react';
import './Table.scss';
import TableItem from './TableItem';
import axios from 'axios';

function Table() {
  const userList = [
    'eunlin',
    'hyeonho28',
    'no13song',
    'davinci2003',
    'kkomul1',
    'gwonllna',
    'tjfzjarlatlgus',
    'always216',
    'mjhee2647',
    'lumicode',
    'theolee72',
    'jungyun01',
  ];
  const problemList = [
    1309, 9278, 16132, 1735, 23048, 15897, 30194, 23041, 2673, 3012,
  ];
  const problemDict = problemList.map((ele, index) => {
    return {
      ele: index,
    };
  });
  const [data, setData] = useState([]);
  const getResult = () => {
    return userList.map(async (ele) => {
      try {
        const resp = axios
          .get('http://localhost:5000/submit/' + ele)
          .then((res) => {
            const row = problemList.map((ele) => {
              const filtered: Submit[] = resp.data.filter((element: Submit) => {
                return Number(element.problemID) === ele;
              });
              // console.log(filtered);
              if (
                filtered.filter((element: Submit) => {
                  return element['submitResult'] === 'ac';
                }).length > 0
              ) {
                return 'ac';
              } else {
                if (filtered.length === 0) return '';
                return filtered[0]['submitResult'];
              }
            });
            // console.log(row);
            return { handle: ele, submitResult: row };
          })
          .catch((err) => {});
      } catch (e) {
        // console.log(e);
        return { handle: ele, submitResult: [] };
      }
    });
  };

  useEffect(() => {
    setData(getResult);
  }, []);

  return (
    <section className="ftco-section">
      <div className="container">
        <div className="row">
          <div className="col-md-12">
            <div className="table-wrap">
              <table className="table table-responsive-xl">
                <thead>
                  <tr>
                    <th>Username</th>
                    {problemList.map((ele) => {
                      return <th>{ele}</th>;
                    })}
                  </tr>
                </thead>
                <tbody>
                  {data.map((ele) => {
                    return (
                      <TableItem
                        handle={ele['handle']}
                        submitResult={ele['submitResult']}
                      />
                    );
                  })}
                </tbody>
              </table>
            </div>
          </div>
        </div>
      </div>
    </section>
  );
}

export default Table;
